    return (
        <>
            <header className={classes.header}>
                <h1>ReactMeals</h1>
                <HeaderCartButton onSow/>
            </header>
            <div className={classes.image}>
                <img src={mealsImage} alt="food"/>
            </div>
        </>
    )
}

export default Header
